  \ possible to rearrange the dominoes in some order such that for each 1 \u2264 i\
  \ \u2264 n the color of the right cell of the i-th domino is different from the\
  \ color of the left cell of the ((i mod n)+1)-st domino. \n\nNote that you can't\
  \ rotate the dominoes, so the left cell always remains the left cell, and the right\
  \ cell always remains the right cell.\n\nCount the number of valid ways to color\
  \ the yet uncolored cells of dominoes. Two ways are considered different if there\
  \ is a cell that is colored white in one way and black in the other. In particular,\
  \ colorings BW WB and WB BW different (and both invalid).\n\nAs this number can\
  \ be very big, output it modulo 998 244 353.\n\nInput\n\nThe first line of the input\
  \ contains a single integer n (1 \u2264 n \u2264 10^5) \u2014 the number of dominoes.\n\
  \nThe next n lines describe dominoes. Each line contains two characters which represent\
  \ the left and the right cell. Character B means that the corresponding cell is\
  \ black, character W means that the corresponding cell is white, and ? means that\
  \ the cell is yet to be colored. \n\nOutput\n\nPrint a single integer \u2014 the\
  \ answer to the problem.\n\nExamples\n\nInput\n\n\n1\n?W\n\n\nOutput\n\n\n1\n\n\n\
  Input\n\n\n2\n??\nW?\n\n\nOutput\n\n\n2\n\n\nInput\n\n\n4\nBB\n??\nW?\n??\n\n\n\
  Output\n\n\n10\n\nNote\n\nIn the first test case, there is only one domino, and\
  \ we need the color of its right cell to be different from the color of its left\
  \ cell. There is only one way to achieve this.\n\nIn the second test case, there\
  \ are only 2 such colorings:\n\nBB WW and WB WB.\nA:"
